// ==========================================
// 3. INFERENCE ENGINE
// ==========================================
function predictCategory(text) {
    const lowerText = text.toLowerCase();

    //  STEP 1: DICTIONARY CHECK (Fast & Accurate)
    for (const [category, keywords] of Object.entries(INDIAN_KEYWORDS)) {
        if (keywords.some(k => lowerText.includes(k))) {
            console.log(`Matched Keyword: "${lowerText}" -> ${category}`);
            return category;
        }
    }

    //  STEP 2: AI BRAIN CHECK (Logistic Regression)
    if (typeof expenseModel === 'undefined' || !expenseModel.vocab) {
        return "Miscellaneous"; // Fallback if model missing
    }

    // A. Tokenize
    const tokens = lowerText.match(/\b\w+\b/g) || [];
    
    // B. Vectorize
    const activeIndices = [];
    tokens.forEach(token => {
        if (expenseModel.vocab.hasOwnProperty(token)) {
            activeIndices.push(expenseModel.vocab[token]);
        }
    });

    if (activeIndices.length === 0) return "Miscellaneous";

    // C. Dot Product + Bias
    const numClasses = expenseModel.classes.length;
    const scores = new Array(numClasses).fill(0);

    for (let c = 0; c < numClasses; c++) {
        let score = expenseModel.biases[c];
        activeIndices.forEach(idx => {
            score += expenseModel.weights[idx][c];
        });
        scores[c] = score;
    }

    // D. ArgMax
    let maxScore = -Infinity;
    let maxIndex = -1;
    for (let i = 0; i < numClasses; i++) {
        if (scores[i] > maxScore) {
            maxScore = scores[i];
            maxIndex = i;
        }
    }
    
    const predicted = expenseModel.classes[maxIndex];
    console.log(`AI Predicted: "${text}" -> ${predicted}`);
    return predicted;
}


// ==========================================
// 4. UI LOGIC & EVENTS
// ==========================================
const expenseForm = document.getElementById("expense-form");
const tbody = document.getElementById("expenses-tbody");
const descInput = document.getElementById("expense-description");
const budgetInput = document.getElementById("monthly-budget");
const navAddBtn = document.getElementById("add-expense-nav-btn");
const panelAddBtn = document.getElementById("add-expense-panel-btn");
const formSection = document.getElementById("add-expense-section");

// Charts
const categoryChartCanvas = document.getElementById("category-chart");
const trendChartCanvas = document.getElementById("monthly-spend-chart");
let categoryChart = null;
let trendChart = null;

// Submit Handler
expenseForm.addEventListener("submit", e => {
    e.preventDefault();
    const date = document.getElementById("expense-date").value;
    const amount = Number(document.getElementById("expense-amount").value);
    const desc = document.getElementById("expense-description").value;
    
    // Predict
    const category = predictCategory(desc); 

    expenses.push({ id: Date.now(), date, amount, description: desc, category });
    saveExpenses();
    refreshUI();
    
    expenseForm.reset();
    document.getElementById("expense-date").valueAsDate = new Date();
    
    // Reset Hint
    const hintEl = document.querySelector(".hint");
    if(hintEl) hintEl.textContent = "Category will be auto-detected...";
});

// Hint Logic
if (descInput) {
    descInput.addEventListener("input", (e) => {
        const text = e.target.value;
        if (text.length > 2) {
            const predicted = predictCategory(text);
            const hintEl = document.querySelector(".hint");
            if(hintEl) {
                hintEl.innerHTML = `Detected: <strong style="color: #22c55e">${predicted}</strong>`;
            }
        }
    });
}

// Global Actions
window.deleteExpense = function(id) {
    if(confirm("Delete this expense?")) {
        expenses = expenses.filter(e => e.id !== id);
        saveExpenses();
        refreshUI();
    }
}

window.resetApp = function() {
    if(confirm(" WARNING: Wipe all data?")) {
        localStorage.clear();
        location.reload();
    }
}

window.downloadCSV = function() {
    if (expenses.length === 0) return alert("No data to export!");
    let csv = "Date,Description,Category,Amount\n" + 
              expenses.map(e => `${e.date},${e.description.replace(/,/g, " ")},${e.category},${e.amount}`).join("\n");
    const link = document.createElement("a");
    link.href = "data:text/csv;charset=utf-8," + encodeURI(csv);
    link.download = "student_expenses.csv";
    link.click();
}

// UI Updaters
function updateTable() {
    if (expenses.length === 0) {
        tbody.innerHTML = `<tr><td colspan="5" style="text-align:center; padding: 20px;">No expenses yet.</td></tr>`;
        return;
    }
    const sorted = [...expenses].sort((a, b) => new Date(b.date) - new Date(a.date));
    tbody.innerHTML = sorted.map(e => `
        <tr>
            <td>${e.date}</td>
            <td>${e.description}</td>
            <td>${e.amount}</td>
            <td><span class="category-tag">${e.category}</span></td>
            <td style="text-align:center;">
                <button onclick="window.deleteExpense(${e.id})" class="delete-btn"></button>
            </td>
        </tr>`).join("");
}

function updateSummary() {
    const total = expenses.reduce((s, e) => s + e.amount, 0);
    const budget = Number(budgetInput.value) || 0;
    const days = new Set(expenses.map(e => e.date)).size;

    document.getElementById("total-spent").innerText = `${total}`;
    const rem = document.getElementById("remaining-budget");
    rem.innerText = `${budget - total}`;
    rem.style.color = (budget - total < 0) ? "#ef4444" : "#22c55e";
    document.getElementById("days-tracked").innerText = days;
    document.getElementById("avg-per-day").innerText = days ? `${Math.round(total/days)}` : "0";

    const alertBox = document.getElementById("budget-alert");
    alertBox.className = "budget-alert";
    if (budget > 0) {
        const ratio = total/budget;
        if(ratio <= 0.5) { alertBox.classList.add("safe"); alertBox.innerHTML = ` Safe Zone (${Math.round(ratio*100)}%)`; }
        else if(ratio <= 0.85) { alertBox.classList.add("warning"); alertBox.innerHTML = ` Warning (${Math.round(ratio*100)}%)`; }
        else { alertBox.classList.add("danger"); alertBox.innerHTML = ` Critical (${Math.round(ratio*100)}%)`; }
    } else {
        alertBox.innerText = "Set a monthly budget to see alerts.";
    }
}

// Charts
function updateCategoryChart() {
    const map = {};
    expenses.forEach(e => map[e.category] = (map[e.category] || 0) + e.amount);
    if (categoryChart) categoryChart.destroy();
    categoryChart = new Chart(categoryChartCanvas, {
        type: "doughnut",
        data: {
            labels: Object.keys(map),
            datasets: [{ data: Object.values(map), backgroundColor: ['#22c55e', '#3b82f6', '#f59e0b', '#ef4444', '#a855f7', '#ec4899', '#64748b', '#14b8a6'], borderWidth: 0 }]
        },
        options: { plugins: { legend: { position: 'right', labels: { color: "#e5e7eb" } } } }
    });
}

function updateTrendChart() {
    const dateTotals = {};
    expenses.forEach(e => { if(e.date) dateTotals[e.date] = (dateTotals[e.date]||0) + e.amount; });
    const dates = Object.keys(dateTotals).sort();
    if (trendChart) trendChart.destroy();
    trendChart = new Chart(trendChartCanvas, {
        type: "line",
        data: { labels: dates, datasets: [{ label: "Daily Spend", data: dates.map(d=>dateTotals[d]), borderColor: '#22c55e', backgroundColor: 'rgba(34,197,94,0.1)', fill: true, tension: 0.3 }] },
        options: { scales: { x: { ticks: { color:"#9ca3af" }, grid: {display:false} }, y: { ticks: { color:"#9ca3af" }, grid: {color:"rgba(148,163,184,0.1)"} } }, plugins: { legend: {display:false} } }
    });
}

function refreshUI() {
    updateTable();
    updateSummary();
    updateCategoryChart();
    updateTrendChart();
    updateBudgetAlert();
}

// Helper
function saveExpenses() { localStorage.setItem(STORAGE_KEY, JSON.stringify(expenses)); }

// Init
const savedBudget = localStorage.getItem(BUDGET_KEY);
if (savedBudget) budgetInput.value = savedBudget;
budgetInput.addEventListener("input", (e) => {
    localStorage.setItem(BUDGET_KEY, e.target.value);
    refreshUI();
});

[navAddBtn, panelAddBtn].forEach(btn => {
    if(btn) btn.addEventListener("click", () => formSection.scrollIntoView({ behavior: "smooth" }));
});

document.getElementById("expense-date").valueAsDate = new Date();
refreshUI();
console.log("Smart Finance Assistant Loaded ");